    def test_local_runner(self):
        seq = ""
        record = SeqRecord(seq, id="Y16952", description="test")
        tmpdirname = tempfile.TemporaryDirectory()
        tmpdir = Path(str(tmpdirname))
        genome_fasta_file = tmpdir / "test.fasta"
        SeqIO.write(record, genome_fasta_file, "fasta")
        out_dir = tmpdir / "out"
        out_dir.mkdir(exist_ok=True, parents=True)
        cores = 4
        strictness = "strict"
        genefinding_tool = "prodigal"
        runner = smbgc.smBGCLocalRunner(
            tmpdir, out_dir, cores, strictness, genefinding_tool
        )
        runner.analyze_genomes()
        # Check if file was created
        file = out_dir / "smBGC" / "antismash_raw_results" / "test.fasta" / "index.html"
        self.assertEqual(file.exists(), True)

